import React, { useEffect } from "react";
import MobileViewInfo from "common/components/MobileViewInfo";
import { BrowserView, MobileOnlyView } from "react-device-detect";
import { fetchCoffee } from "apis/square/AxiosRequestsSquare";

const Square = () => {
  useEffect(() => {
    fetchCoffee();
  }, []);

  return (
    <>
      <BrowserView>
        <h1>This is rendered only in browser</h1>
      </BrowserView>
      <MobileOnlyView>
        <MobileViewInfo />
      </MobileOnlyView>
    </>
  );
};

export default Square;
